import React from "react";
import {TodoIcon} from './';

function CompleteIcon({ completed, onComplete}) {
    return (
        <TodoIcon
        type="check"
        // color="gray"
        color = {completed ? 'green' : 'gray'}
        onClick={onComplete}
        />
    );
}

export { CompleteIcon};
